actions/galaxy/.body:
galaxy
$ launch galaxy myapp.com path/to/optional/settings.json

The galaxy action will deploy your app to Galaxy. You will need to have a galaxy account to use this feature. You will also need to add two variables to launch.json.
{
  &quot;GALAXY_DEPLOY_HOSTNAME&quot;: &quot;galaxy.meteor.com&quot;,
  &quot;GALAXY_SESSION_FILE&quot;: &quot;path/to/deployment_token.json&quot;
}


GALAXY_DEPLAY_HOSTNAME: the region in galaxy you wish to deploy to.
GALAXY_SESSION_FILE: the path to the deployment taken used to authenticate with Galaxy. You can generate this by running:

$ METEOR_SESSION_FILE=deployment_token.json meteor login

actions/hockey/.body:
hockey
$ launch hockey

The hockey action will deploy your Cordova app to Hockey. Hockey supports both iOS and Android app distribution, so this action can upload either one, or both, based on which platforms you have added to your Meteor project.
Setup
First, make sure you have added the keys describe in the build action.
Make sure you have created an application on Hockey corresponding to the type(s) of application(s) you want to upload. If you will be uploading both iOS and Android apps, you will need two separate apps on Hockey.
iOS
Generate an API key for your iOS app on Hockey, and then add it to your launch.json.
{
  &quot;IOS_HOCKEY_TOKEN&quot;: &quot;tokenhere&quot;
}

Android
Generate an API key for your Android app on Hockey. You will also need the id of your application on Hockey for Android. Then, add it to your launch.json.
{
  &quot;ANDROID_HOCKEY_TOKEN&quot;: &quot;tokenhere&quot;,
  &quot;ANDROID_HOCKEY_ID&quot;: &quot;idhere&quot;
}

actions/playstore/.body:
playstore
$ launch playstore

The playstore action will compile your Cordova build for Android, sign the APK file, and upload it to the Google Play Store. Currently, it uploads to the alpha channel, but that can be changed.
Setup
You will need to have created an application on the Google Play Store.
You will need to generate an auth file to allow uploading. To do this, navigate to Settings -&gt; API Access in your Google Play account, then create a service account. When asked, generate a JSON file for auth, and download it. Provide the path to this file in your launch.json.
{
  &quot;PLAY_AUTH_FILE&quot;: &quot;&quot;
}
